(74, 'App\\Models\\DataSetting', 86, 'en', 'about_us', '<p>Introducing <strong>HYST</strong>, your go-to app for unlocking a world of local and nearby offers right at your fingertips! HYST is your personalized guide to discovering the best deals, discounts, and promotions in your area. Say goodbye to missing out on fantastic opportunities and welcome a new era of savings and convenience.</p>\r\n\r\n<p><strong>Key Features:</strong></p>\r\n\r\n<p><strong>1. Localized Offers:&nbsp;</strong>HYST curates a collection of exclusive deals tailored to your location. Whether you&#39;re a local resident or just passing through, discover hidden gems and unbeatable discounts in your vicinity.</p>\r\n\r\n<p><strong>2. Real-Time Updates:&nbsp;</strong>Stay in the loop with up-to-the-minute updates on the latest offers. From trendy cafes to local boutiques, HYST keeps you informed about all the exciting opportunities nearby.</p>\r\n\r\n<p><strong>3. Customized Preferences:</strong>&nbsp;Tailor your experience by setting preferences based on your interests. Whether you&#39;re looking for dining specials, retail discounts, or entertainment deals, HYST ensures your offers align with your preferences.</p>\r\n\r\n<p><strong>4. Effortless Navigation:</strong> The app&#39;s intuitive interface makes it easy to explore and find the best deals near you. Effortlessly navigate through categories and discover what your local businesses have to offer.</p>\r\n\r\n<p><strong>5. Savings Tracker:</strong>&nbsp;Keep track of your savings with HYST&#39;s built-in savings tracker. Watch your expenses shrink as you take advantage of exclusive offers and promotions.</p>\r\n\r\n<p><strong>6. Community Ratings and Reviews:</strong>&nbsp;Make informed decisions with the help of community ratings and reviews. See what others are saying about local businesses and make the most of your HYST experience.</p>\r\n\r\n<p>Say goodbye to FOMO (Fear of Missing Out) and hello to a world of savings and opportunities with HYST. Download the app today and unlock a treasure trove of local offers designed just for you!</p>', NULL, NULL),
