(76, 'App\\Models\\DataSetting', 88, 'en', 'terms_and_conditions', '<p><strong>HYST - Terms and Conditions</strong></p>\r\n\r\n<p>Please read these Terms and Conditions (&quot;Terms,&quot; &quot;Terms and Conditions&quot;) carefully before using the HYST mobile application (the &quot;Service&quot;) operated by DGL&nbsp;Digital (&quot;us,&quot; &quot;we,&quot; or &quot;our&quot;).</p>\r\n\r\n<p><strong>1. Acceptance of Terms</strong></p>\r\n\r\n<p>By accessing or using the HYST app, you agree to comply with and be bound by these Terms. If you disagree with any part of the terms, then you may not access the Service.</p>\r\n\r\n<p><strong>2. Use of the Service</strong></p>\r\n\r\n<p>2.1. User Accounts:&nbsp;To use certain features of the Service, you may be required to create a user account. You agree to provide accurate, current, and complete information during the registration process and to update such information to keep it accurate, current, and complete.</p>\r\n\r\n<p>2.2. User Responsibilities: You are responsible for maintaining the confidentiality of your account and password, including but not limited to restricting access to your mobile device and account. You agree to accept responsibility for all activities that occur under your account.</p>\r\n\r\n<p><strong>3. Privacy Policy</strong></p>\r\n\r\n<p>Your use of the HYST app is also governed by our Privacy Policy.</p>\r\n\r\n<p><strong>4. Offers and Deals</strong></p>\r\n\r\n<p>4.1. Accuracy of Information:&nbsp;HYST is not responsible for the accuracy of the information provided by local businesses regarding offers and deals. Users are encouraged to verify the details with the respective businesses.</p>\r\n\r\n<p>4.2. Availability:&nbsp;Offers and deals are subject to availability and may change without notice. HYST is not liable for any unavailability of offers or deals.</p>\r\n\r\n<p><strong>5. User Conduct</strong></p>\r\n\r\n<p>5.1. Prohibited Activities:&nbsp;Users agree not to engage in any activity that may interfere with the proper functioning of the Service, including but not limited to uploading or transmitting malicious code.</p>\r\n\r\n<p>5.2. Compliance with Laws:&nbsp;Users agree to comply with all applicable laws and regulations while using the HYST app.</p>\r\n\r\n<p><strong>6. Termination</strong></p>\r\n\r\n<p>We may terminate or suspend access to our Service immediately, without prior notice or liability, for any reason whatsoever, including without limitation if you breach these Terms.</p>\r\n\r\n<p><strong>7. Changes to Terms</strong></p>\r\n\r\n<p>We reserve the right to modify or replace these Terms at any time. Your continued use of the Service after any such changes constitute your acceptance of the new Terms.</p>\r\n\r\n<p><strong>8. Contact Us</strong></p>\r\n\r\n<p>If you have any questions about these Terms, please contact us at [support@hyst.uk].</p>\r\n\r\n<p>Last Updated: 10th Nov 2023</p>', NULL, NULL),
(77, 'App\\Models\\DataSetting', 89, 'en', 'privacy_policy', '<p><strong>HYST - Privacy Policy</strong></p>\r\n\r\n<p>Last Updated: 10th Nov 2023</p>\r\n\r\n<p>[Your Company Name] (&quot;us,&quot; &quot;we,&quot; or &quot;our&quot;) operates the HYST mobile application (the &quot;Service&quot;). This page informs you of our policies regarding the collection, use, and disclosure of personal data when you use our Service and the choices you have associated with that data.</p>\r\n\r\n<p><strong>1. Information Collection and Use</strong></p>\r\n\r\n<p>We collect several different types of information for various purposes to provide and improve our Service to you.</p>\r\n\r\n<p><strong>2. Types of Data Collected</strong></p>\r\n\r\n<p><strong>2.1. Personal Data:</strong><br />\r\n- While using our Service, you may be asked to provide certain personally identifiable information that can be used to contact or identify you (&quot;Personal Data&quot;). Personally identifiable information may include, but is not limited to:<br />\r\n&nbsp; - Email address<br />\r\n&nbsp; - First name and last name<br />\r\n&nbsp; - Phone number<br />\r\n&nbsp; - Address, State, Province, ZIP/Postal code, City</p>\r\n\r\n<p>2.2. <strong>Usage Data:</strong><br />\r\n- We may also collect information on how the Service is accessed and used (&quot;Usage Data&quot;). This Usage Data may include information such as your device&#39;s Internet Protocol address</p>', NULL, NULL),
